void MaxwellianOnBasisGauss1x3vSer_P1_evAtConfOrd(const double *den, const double *flowU, const double *vtSq, const double *bmag, double *flowUOrd, double *vtSqOrd, double *fMFacOrd, double *bmagOrd) {

  double m0Ord[2];
  m0Ord[0] = 0.7071067811865475*(den[0]-den[1]); 
  m0Ord[1] = 0.7071067811865475*(den[1]+den[0]); 

  flowUOrd[0] = 0.7071067811865475*(flowU[0]-flowU[1]); 
  flowUOrd[1] = 0.7071067811865475*(flowU[1]+flowU[0]); 
  flowUOrd[2] = 0.7071067811865475*(flowU[2]-flowU[3]); 
  flowUOrd[3] = 0.7071067811865475*(flowU[3]+flowU[2]); 
  flowUOrd[4] = 0.7071067811865475*(flowU[4]-flowU[5]); 
  flowUOrd[5] = 0.7071067811865475*(flowU[5]+flowU[4]); 

  vtSqOrd[0] = 0.7071067811865475*(vtSq[0]-vtSq[1]); 
  vtSqOrd[1] = 0.7071067811865475*(vtSq[1]+vtSq[0]); 

  if ((vtSqOrd[0] > 0.) && (m0Ord[0] > 0.))
    fMFacOrd[0] = m0Ord[0]/std::pow(2.506628274631001*sqrt(vtSqOrd[0]),3.0); 
  else
    fMFacOrd[0] = 0.0;
  if ((vtSqOrd[1] > 0.) && (m0Ord[1] > 0.))
    fMFacOrd[1] = m0Ord[1]/std::pow(2.506628274631001*sqrt(vtSqOrd[1]),3.0); 
  else
    fMFacOrd[1] = 0.0;

}

